A trait defines a particular type's functionality and can share with other types. We can use traits to define shared behavior abstractly. Traits allow us to define interfaces or shared behaviors on types. To implement a trait for a type, we must implement methods of that trait. When working with Structs, we have enabled Debug and Display traits. Rust supports defining and using custom traits. // Display Struct without Trait #[derive(Debug)] struct Show { name: String, total_seasons: u8 } #[derive(Debug)]
struct Season { season_name: String, season_id: u8, year: u16
} fn main(){ let friends = Show { name:String::from("Friends"), total_seasons:10 }; let currseason = Season { season_name:String::from("Last Season"), season_id:10, year:2004 }; println!("{:?}", friends); println!("{:?}", currseason);
} // Implementing the same using Traits struct Show { name: String, total_seasons: u8 } struct Season { season_name: String, season_id: u8, year: u16
} //We will list the method signature for all the methods that a type // implementing the Info trait will need to have. trait Info { // Any datatype that implements this "detail" trait will return a string. fn detail(&self) -> String;
} impl Info for Show{ fn detail(&self) -> String{ format!("{} contains {} seasons",self.name,self.total_seasons) }
} impl Info for Season{ fn detail(&self) -> String{ format!("you are watching {} ({}) telecasted in {}", self.season_name, self.season_id, self.year) }
} fn main(){ let friends = Show { name:String::from("Friends"), total_seasons:10 }; let currseason = Season { season_name:String::from("Last Season"), season_id:10, year:2004 }; println!("{}", friends.detail()); println!("{}", currseason.detail());
}

