ult is always multiple of 4. Another Example convert f to Base64 102 = 01100110 011001 100000 Zg== Think about sending Image (binary) as JSON, binary wont work. But sending as Base64 works the best. https://elmah.io/tools/base64-image-encoder/ Demo Img HTML // Convert to Base64 use base64::encode;
